I know I’ve only made one T shirt quilt, and that was maybe one too many for me!🤣 I was not a huge fan of the whole process at all, but the quilt is well loved, so that does count for something.🤗

@jekah_a_quilter did an excellent job piecing this big T shirt quilt. T shirt quilts aren’t always the prettiest thing to share, but this one felt like it needed sharing.🫶

